// DanhSachSinhVien.js
import React from 'react';
import SinhVien from './SinhVien';
import './DanhSachSinhVien.css';

const studentsData = [
  { id: 1, name: 'Nguyen Van A', internship: 'Company X' },
  { id: 2, name: 'Tran Thi B', internship: 'Company Y' },
  // Thêm thông tin sinh viên khác nếu cần
];

const DanhSachSinhVien = () => {
  return (
    <div className="danh-sach-sinh-vien">
      <h2>Danh Sách Sinh Viên</h2>
      <table className="sinh-vien-table">
        <thead>
          <tr>
            <th>STT</th>
            <th>MSSV</th>
            <th>Tên Sinh Viên</th>
            <th>Quá Trình Thực Tập</th>
          </tr>
        </thead>
        <tbody>
          {studentsData.map((student, index) => (
            <SinhVien key={student.id} student={student} stt={index + 1} />
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default DanhSachSinhVien;
